generated.css:
@import url("https://fonts.googleapis.com/css?family=Montserrat:400,700|https://fonts.googleapis.com/css?family=Crimson+Text:400i");
*,
*::before,
*::after {
  box-sizing: inherit;
}

html {
  box-sizing: border-box;
}

body {
  margin: 0;
  padding: 0;
}

ul {
  margin: 0;
  padding: 0;
  list-style: none;
}

a {
  text-decoration: none;
}

img {
  max-width: 100%;
  height: auto;
  border: 0;
}

.header {
  padding: 65px 40px;
  background-color: #161b29;
}

.header__top {
  display: flex;
  align-items: center;
}

.header__logo {
  display: flex;
  align-items: center;
  font-family: "Montserrat", "Arial", sans-serif;
  font-weight: 700;
  color: #ffffff;
  font-size: 24px;
  line-height: 1.5;
  margin-left: 50px;
  margin-right: auto;
}

.header__logo-img {
  margin-right: 15px;
}

.header__nav {
  display: flex;
  align-items: center;
}

.header__nav-link {
  font-family: "Montserrat", "Arial", sans-serif;
  font-weight: 700;
  color: #ffffff;
  font-size: 16px;
  line-height: 1.5;
  margin-right: 70px;
}
.header__nav-link:last-child() {
  margin-right: 0;
}
